function run() {

  print("*********** XHR LARGE Get TEST 1 *****************");
  function onTimeoutHandler(pe) {
    print("*** timeout event ***"+" ReadyState:"+this.readyState)
    print("lengthComputable:"+pe.lengthComputable);
    print("loaded:"+pe.loaded);
    print("total:"+pe.total);
  }
  function onProgressHandler(pe) {
    print("*** progress event ***"+" ReadyState:"+this.readyState)
    print("lengthComputable:"+pe.lengthComputable);
    print("loaded:"+pe.loaded);
    print("total:"+pe.total);
  }
  function onLoadStartHandler(pe) {
    print("*** loadstart event ***"+" ReadyState:"+this.readyState);
    print("lengthComputable:"+pe.lengthComputable);
    print("loaded:"+pe.loaded);
    print("total:"+pe.total);
  }
  function onErrorHandler(pe) {
    print("*** error event ***"+" ReadyState:"+this.readyState)
    print("lengthComputable:"+pe.lengthComputable);
    print("loaded:"+pe.loaded);
    print("total:"+pe.total);
  }
  function onLoadendHandler(pe) {
    print("*** loadend event ***"+" ReadyState:"+this.readyState)
    print("lengthComputable:"+pe.lengthComputable);
    print("loaded:"+pe.loaded);
    print("total:"+pe.total);
  }
  function onTimeoutHandler(pe) {
    print("*** timeout event ***"+" ReadyState:"+this.readyState)
    print("lengthComputable:"+pe.lengthComputable);
    print("loaded:"+pe.loaded);
    print("total:"+pe.total);
  }
  function onAbortHandler(pe) {
    print("*** abort event ***"+" ReadyState:"+this.readyState)
    print("lengthComputable:"+pe.lengthComputable);
    print("loaded:"+pe.loaded);
    print("total:"+pe.total);
  }
  function onLoadHandler(pe) {
    print("*** load event ***"+" ReadyState:"+this.readyState)
    print("lengthComputable:"+pe.lengthComputable);
    print("loaded:"+pe.loaded);
    print("total:"+pe.total);
  }

  var xhr = new XMLHttpRequest();
  xhr.timeout=5000;

  xhr.ontimeout=onTimeoutHandler;
  xhr.onprogress=onProgressHandler;
  xhr.onabort=onAbortHandler;
  xhr.addEventListener("load", onLoadHandler);
  xhr.addEventListener("loadstart", onLoadStartHandler);
  xhr.addEventListener("loadend", onLoadendHandler);
  xhr.addEventListener("error", onErrorHandler);

  xhr.open("GET", "http://releases.ubuntu.com/14.04.3/ubuntu-14.04.3-desktop-amd64.iso?_ga=1.160886395.714603943.1454563877");
  xhr.send();
  xhr.abort();

  xhr.send();

  xhr.open("GET", "http://releases.ubuntu.com/14.04.3/ubuntu-14.04.3-desktop-amd64.iso?_ga=1.160886395.714603943.1454563877");
  xhr.send();

  print("************* Done *******************");
}
run();
